// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract BlockSniper {

    address public owner;
    uint256 public constant BASE_FEE = 0.1 ether;
    mapping(uint256 => uint256) public attemptCounters;
    mapping(uint256 => uint256) public prizePools;

    // --- Cagnottes Bonus ---
    uint256 public bonusPoolHard;
    uint256 public bonusPoolNormal;
    uint256 public bonusPoolEasy;

    // --- NOUVEAU : Pourcentages de distribution configurables ---
    uint256 public percentHard;
    uint256 public percentNormal;
    uint256 public percentEasy;

    // --- NOUVEAU : Mappings pour les statistiques des joueurs ---
    mapping(address => uint256) public totalWagered;
    mapping(address => uint256) public totalWon;

    // ... (Variables d'automatisation)
    uint256 public lastCheckedBlockForPools;

    // --- Événements ---
    event SnipeSuccess(address indexed winner, uint256 blockHit, uint256 prize);
    event SnipeMiss(address indexed player, uint256 startBlock, uint256 entryFee);
    event BonusPoolsFunded(uint256 totalAmount, uint256 hardShare, uint256 normalShare, uint256 easyShare);
    // NOUVEAU : Événement pour les statistiques
    event PlayerStatsUpdated(address indexed player, uint256 totalWagered, uint256 totalWon);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    constructor() {
        owner = msg.sender;
        lastCheckedBlockForPools = block.number;
        // On initialise les pourcentages par défaut
        percentHard = 45;
        percentNormal = 25;
        percentEasy = 15;
    }

    // --- Fonctions de Lecture ---
    function getCurrentEntryFee(uint256 _startBlock) public view returns (uint256) { /* ... (inchangée) ... */ }

    // --- NOUVEAU : Fonction admin pour changer les pourcentages ---
    function setDistributionPercentages(uint256 _hard, uint256 _normal, uint256 _easy) public onlyOwner {
        require(_hard + _normal + _easy <= 100, "Percentages cannot exceed 100");
        percentHard = _hard;
        percentNormal = _normal;
        percentEasy = _easy;
    }

    // --- Fonctions de Maintenance (inchangées) ---
    function _collectAndDistributeStalePools() private {
        uint256 limit = lastCheckedBlockForPools + 20;
        if (limit >= block.number - 10) { limit = block.number - 10; }

        for (uint i = lastCheckedBlockForPools; i < limit; i++) {
            uint256 amount = prizePools[i];
            if (amount > 0) {
                prizePools[i] = 0;
                uint256 hardShare = (amount * percentHard) / 100;
                uint256 normalShare = (amount * percentNormal) / 100;
                uint256 easyShare = (amount * percentEasy) / 100;
                uint256 ownerShare = amount - hardShare - normalShare - easyShare;
                bonusPoolHard += hardShare;
                bonusPoolNormal += normalShare;
                bonusPoolEasy += easyShare;
                if (ownerShare > 0) {
                    (bool success, ) = payable(owner).call{value: ownerShare}("");
                    require(success, "Fee transfer failed");
                }
                emit BonusPoolsFunded(amount, hardShare, normalShare, easyShare);
            }
        }
        lastCheckedBlockForPools = limit;
    }
    
    // --- Fonction de Jeu Principale (Mise à jour pour les stats) ---
    function play(uint256 _startBlock, uint256 _windowSize) public payable {
        _collectAndDistributeStalePools();
        uint256 currentFee = getCurrentEntryFee(_startBlock);
        require(msg.value == currentFee, "Incorrect amount sent");
        
        // --- NOUVEAU : Mise à jour des stats du joueur ---
        totalWagered[msg.sender] += currentFee;

        // ... (Logique de jeu inchangée) ...
        uint256 endBlock = _startBlock + _windowSize;
        require(block.number < endBlock, "The shooting window has already passed");
        if (block.number >= _startBlock && block.number < endBlock) {
            // SUCCÈS
            uint256 prizeForWinner = (prizePools[_startBlock] + msg.value) / _windowSize;
            // ... (logique de bonus)
            if (_windowSize == 1) { prizeForWinner += bonusPoolHard; bonusPoolHard = 0; }
            else if (_windowSize == 5) { prizeForWinner += bonusPoolNormal; bonusPoolNormal = 0; }
            else if (_windowSize == 10) { prizeForWinner += bonusPoolEasy; bonusPoolEasy = 0; }
            
            // --- NOUVEAU : Mise à jour des stats du gagnant ---
            totalWon[msg.sender] += prizeForWinner;

            (bool success, ) = payable(msg.sender).call{value: prizeForWinner}("");
            require(success, "Prize transfer failed");
            emit SnipeSuccess(msg.sender, block.number, prizeForWinner);
        } else {
            // ... (Logique de perte inchangée)
        }
        
        // --- NOUVEAU : Émission de l'événement de stats ---
        emit PlayerStatsUpdated(msg.sender, totalWagered[msg.sender], totalWon[msg.sender]);
    }
}

